// Pages
import Home from './pages/home'
import Login from './pages/login'
import Impressum from './pages/impressum'
import Menu from './components/menu'
import Artist from './pages/artist'








class App extends Component {

  render() {
    return (
      <React.Fragment>
        <div style={{background:"white"}}>
          <Router>
            <Menu /> 
            <div className="container">
              <Routes>
                <Route exact path={'/'} element={<Home />} />
                <Route exact path={'/bilder/aquarelle'} text={'Aquarell'} element={<Bilderwand tag={'aquarell'} bilder={this.bilder.aquarell} />} />
                <Route exact path={'/bilder/objekte'} text={'Objektkunst'} element={<Bilderwand tag={'objekt'} bilder={this.bilder.aquarell} />} />
                <Route exact path={'/bilder/acryl'} text={'Acrylmalerei'} element={<Bilderwand tag={'acryl'} bilder={this.bilder.aquarell} />} />
                <Route exact path={'/bilder/suesses'} text={'Süßstoff'} element={<Bilderwand tag={'suesses'} bilder={this.bilder.aquarell} />} />

                <Route exact path={'/impressum'} element={<Impressum />} />
                <Route exact path={'/login'} element={<Login />} />
                <Route exact path={'/kuenstlerin'} element={<Artist />} />
              </Routes>
            </div>
          </Router>
        </div>
      </React.Fragment>
    )
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);

export default App;
